import { React } from "react";

const Favorites = ({ props }) => {




  return (
    <div>
      {props.map((fav, i) => {
        return (
          <div>
          <ul key={i}>
            <li>
              <p>{fav.name}</p>
              <img src={fav.img} alt={fav.name} />
            </li>
          </ul>
          <button type="button" className="btn btn-warning">
          ELIMINAR DE FAVORITOS
        </button>
          </div>
        );
      })}
    </div>
  );
};

export default Favorites;
